import React from 'react';
import { Box, Container, Typography, Grid, IconButton } from '@mui/material';
import { styled } from '@mui/material/styles';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import TwitterIcon from '@mui/icons-material/Twitter';
import InstagramIcon from '@mui/icons-material/Instagram';
import EmailIcon from '@mui/icons-material/Email';
import PhoneIcon from '@mui/icons-material/Phone';
import LocationOnIcon from '@mui/icons-material/LocationOn';

const FooterContainer = styled(Box)(({ theme }) => ({
  backgroundColor: theme.palette.primary.main,
  color: 'white',
  padding: theme.spacing(6, 0),
  marginTop: 'auto',
}));

const FooterSection = styled(Box)(({ theme }) => ({
  marginBottom: theme.spacing(3),
}));

const SocialIcon = styled(IconButton)(({ theme }) => ({
  color: 'white',
  marginRight: theme.spacing(2),
  '&:hover': {
    backgroundColor: 'rgba(255, 255, 255, 0.1)',
  },
}));

const ContactItem = styled(Box)(({ theme }) => ({
  display: 'flex',
  alignItems: 'center',
  marginBottom: theme.spacing(2),
  '& svg': {
    marginRight: theme.spacing(1),
  },
}));

const Footer = () => {
  return (
    <FooterContainer id="footer-section">
      <Container maxWidth="lg">
        <Grid container spacing={4}>
          <Grid item xs={12} md={4}>
            <FooterSection>
              <Typography variant="h4" gutterBottom>
                TEAM VXM
              </Typography>
              <Typography variant="body1">
                Revolutionizing legal research through AI and blockchain technology.
              </Typography>
            </FooterSection>
          </Grid>
          
          <Grid item xs={12} md={4}>
            <FooterSection>
              <Typography variant="h6" gutterBottom>
                Contact Us
              </Typography>
              <ContactItem>
                <EmailIcon />
                <Typography>support@searchcourt.com</Typography>
              </ContactItem>
              <ContactItem>
                <PhoneIcon />
                <Typography>+91 XXXXXXXXXX</Typography>
              </ContactItem>
              <ContactItem>
                <LocationOnIcon />
                <Typography>SearchCourt HQ, Bangalore, India</Typography>
              </ContactItem>
            </FooterSection>
          </Grid>

          <Grid item xs={12} md={4}>
            <FooterSection>
              <Typography variant="h6" gutterBottom>
                Follow Us
              </Typography>
              <Box>
                <SocialIcon
                  href="https://linkedin.com"
                  target="_blank"
                  aria-label="LinkedIn"
                >
                  <LinkedInIcon />
                </SocialIcon>
                <SocialIcon
                  href="https://twitter.com"
                  target="_blank"
                  aria-label="Twitter"
                >
                  <TwitterIcon />
                </SocialIcon>
                <SocialIcon
                  href="https://instagram.com"
                  target="_blank"
                  aria-label="Instagram"
                >
                  <InstagramIcon />
                </SocialIcon>
              </Box>
            </FooterSection>
          </Grid>
        </Grid>

        <Typography
          variant="body2"
          align="center"
          sx={{ marginTop: 4, opacity: 0.8 }}
        >
          Â© {new Date().getFullYear()} SearchCourt. All rights reserved.
        </Typography>
      </Container>
    </FooterContainer>
  );
};

export default Footer;
